.ipa\\\"\"\n\t\t\t\tdo script with command \"scp \\\"${CONFIGURATION_BUILD_DIR}/$executableName.plist\\\" \\\"$sftpServerDirectoryPath/$executableName.plist\\\"\"\n\t\t\t\tdo script with command \"scp \\\"${PROJECT_DIR}/../ReleaseNotes.html\\\" \\\"$sftpServerDirectoryPath/ReleaseNotes.html\\\"\"\n\t\t\t\tdo script with command \"scp \\\"${PROJECT_DIR}/../AdHoc.mobileprovision\\\" \\\"$sftpServerDirectoryPath/PlanetRomeo_AdHoc.mobileprovision\\\"\"\n\t\t\tend tell\n\t\tEOF\n\n\t\tcd \"${PROJECT_DIR}\";\n\tfi\nfi\n\nexit 0;";
